import React from 'react'

const cartItemsList = []

function AddToCart(props) {
    console.log("props in addtocart component", props);
    if (cartItemsList.indexOf(props.shoppingItemDetails.item.title) == -1) {
     cartItemsList.push(props.shoppingItemDetails);
    }
    return (
        <div>name:{props.shoppingItemDetails.item.title}</div>
    )
}

export default AddToCart;
